      "psicash#alert#logged-out": "[ƤşīīƇȧȧşħ ȧȧƈƈǿǿŭŭƞŧ ŀǿǿɠǿǿŭŭŧ ƈǿǿḿƥŀḗḗŧḗḗ.]",
