      "psicash#pane-need-more-psicash-body": "[Īīƞ ǿǿřḓḗḗř ȧȧƈŧīīṽȧȧŧḗḗ Şƥḗḗḗḗḓ Ɓǿǿǿǿşŧ, ẏǿǿŭŭ ƞḗḗḗḗḓ ŧǿǿ ƀŭŭẏ ḿǿǿřḗḗ ƤşīīƇȧȧşħ.]",
      "psicash#pane-need-more-psicash-header": "[Ẏǿǿŭŭ ƞḗḗḗḗḓ ḿǿǿřḗḗ ƤşīīƇȧȧşħ!]",
